import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import Typed from "typed.js";
import VanillaTilt from "./vanilla-tilt"; // Import your VanillaTilt.js file
import "./App.css"; // Import your CSS files

function App() {
  useEffect(() => {
    AOS.init();
    VanillaTilt.init(document.querySelectorAll(".Interest-box"), {
      max: 25,
      speed: 400,
    });

    const typed = new Typed(".auto-type", {
      strings: ["student", "developer", "designer"],
      typeSpeed: 50,
      backSpeed: 30,
      backDelay: 2000,
      startDelay: 1000,
      loop: true,
    });

    return () => {
      AOS.refresh();
      VanillaTilt.destroy();
      typed.destroy();
    };
  }, []);

  return (
    <div className="App">
      {/* ========== SIDEBAR ========== */}
      <div className="nav_toggle" id="nav-toggle">
        <i className="uil uil-bars"></i>
      </div>

      <aside className="sidebar" id="sidebar">
        <nav className="nav">
          <div className="nav_menu">
            <div className="menu">
              <ul className="nav_list">
                <li className="nav_item">
                  <a href="#home" className="nav_link">
                    Home
                  </a>
                </li>
                <li className="nav_item">
                  <a href="#about" className="nav_link">
                    Hobby
                  </a>
                </li>
                {/* Add more navigation items as needed */}
              </ul>
            </div>
          </div>

          <div className="nav_close" id="nav-close">
            <i className="uil uil-multiply"></i>
          </div>
        </nav>
      </aside>

      {/* ========== MAIN ========== */}
      <main className="main">
        {/* ===== Home ===== */}
        <section className="home" id="home">
          {/* Your Home Section JSX */}
        </section>

        {/* ===== HOBBY ===== */}
        <section className="montero-hobby" id="about">
          {/* Your Hobby Section JSX */}
        </section>

        {/* ===== MOVIES ===== */}
        <section className="Montero-Fave-Movie" id="movies">
          {/* Your Movies Section JSX */}
        </section>

        {/* ===== INTEREST ===== */}
        <section className="Retiza-Montero-Interest" id="Interest">
          {/* Your Interest Section JSX */}
        </section>

        {/* ===== CONTACT ===== */}
        <section className="contact section" id="contact">
          {/* Your Contact Section JSX */}
        </section>

        {/* ===== FOOTER ===== */}
        <footer>{/* Your Footer JSX */}</footer>
      </main>

      {/* ========== JAVASCRIPT ========== */}
      <script type="text/javascript" src="script.js"></script>
    </div>
  );
}

export default App;
